import{e as p}from"./app.630af5f2.js";import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";const a={},r=p('<h1 id="b" tabindex="-1"><a class="header-anchor" href="#b" aria-hidden="true">#</a> B\u2026</h1><p>\u9ED1\u8272\u7684\u4F17\u795E\u4E4B\u5854\u5C79\u7ACB\u5927\u5730\u4E4B\u98A0\uFF0C\u5374\u975E\u6700\u8FD1\u5929\u7A79\u7684\u6240\u5728\u3002</p><p>\u5728\u5580\u91CC\u65AF\u62DC\u4E9A\u65AF\u5927\u9646\u4E4B\u5916\uFF0C\u662F\u6D69\u701A\u65E0\u8FB9\u7684\u6D77\u6D0B\u73AF\u62B1\u3002\u4E00\u53EA\u5DE8\u5927\u7684\u767D\u9E1F\u7FF1\u7FD4\u5728\u4E03\u6D77\u4E4B\u4E0A\u5DF2\u6709\u4E07\u8F7D\u3002</p><p>\u5728\u767D\u9E1F\u7684\u80CC\u4E0A\uFF0C\u6709\u7740\u8D77\u4F0F\u7684\u5C71\u5CE6\uFF0C\u873F\u8712\u7684\u6CB3\u6D41\u8FD8\u6709\u8FE6\u84DD\u65CF\u4EBA\u5EFA\u9020\u7684\u5929\u7A7A\u4E4B\u57CE\u3002\u5927\u9646\u4E0A\u7684\u822A\u6D77\u5BB6\u66FE\u8BB0\u8F7D\u8FC7\u8230\u961F\u5728\u6D77\u6D0B\u906D\u9047\u7A81\u5982\u5176\u6765\u7684\u767D\u663C\u65E5\u98DF\u3002\u5176\u5B9E\u90A3\u53EA\u662F\u767D\u9E1F\u98DE\u8FC7\u7684\u65F6\u5019\uFF0C\u644A\u5F00\u7684\u53CC\u7FFC\u957F\u4E45\u5730\uFF0C\u957F\u4E45\u5730\u906E\u95ED\u5929\u65E5\u3002</p><p>\u8FD9\u5DE8\u5927\u7684\u767D\u9E1F\uFF0C\u98DE\u5EA6\u7684\u5929\u7A7A\u4E4B\u57CE\u3002\u4EC1\u7231\u7684\u7687\u65CF\u7EDF\u9886\u56DB\u65B9\uFF0C\u82F1\u660E\u957F\u6CBB\uFF0C\u767E\u59D3\u5B89\u4E50\u3002\u6570\u5343\u5E74\u7684\u5B81\u606F\uFF0C\u9A81\u52C7\u7684\u6B66\u5C06\u4E5F\u8981\u9057\u5FD8\u6218\u4E8B\u3002</p><p>\u8F6E\u56DE\u4E2D\u603B\u6709\u5B89\u8BE6\u4E16\u754C\uFF0C\u5F7C\u5728\u5929\uFF0C\u65E0\u5F79\u82E6\uFF0C\u65E0\u5F81\u4F10\u3002\u5373\u4FBF\u897F\u5929\u7684\u9B54\u65CF\uFF0C\u4E5F\u53EA\u5728\u8FB9\u5883\u5076\u5C14\u6765\u72AF\uFF0C\u4E45\u65E0\u5927\u4E71\u3002</p><p>\u5EFF\u5E74\u4E4B\u524D\uFF0C\u7687\u540E\u4EA7\u4E0B\u4E00\u5BF9\u53CC\u751F\u59D0\u5F1F\u3002</p><p>\u300C\u8FE6\u697C\u300D\u662F\u7687\u65CF\u59D3\u6C0F\u3002</p><p>\u300C\u82CD\u5170\u300D\u662F\u987B\u5F25\u5C71\u9876\u5B64\u9AD8\u7EAF\u7CB9\u7684\u7EDD\u8272\u82B1\u3002</p><p>\u300C\u686B\u6469\u300D\u5219\u662F\u5929\u795E\u8D60\u4E88\u4EBA\u4E16\u7684\u9AD8\u8D35\u4E54\u6728\u3002</p><p>\u5929\u7A7A\u7684\u81E3\u6C11\u6B22\u4E50\u5730\u9882\u6B4C\uFF0C\u5E76\u4F20\u4ED6\u4EEC\u5723\u7F8E\u7684\u540D\uFF0C\u971E\u5149\u548C\u7965\u4E91\u4EA6\u56E0\u4ED6\u4EEC\u964D\u4E34\u3002</p><p>\u8FE6\u697C\u82CD\u5170\uFF0C\u8FE6\u697C\u686B\u6469\u3002</p><p>\u4ED6\u4EEC\u6709\u7740\u7687\u65CF\u7F8E\u4E3D\u7684\u7070\u77B3\uFF0C\u9AD8\u8D35\u5916\u8868\uFF0C\u5584\u5FF5\u7684\u5FC3\u3002</p><p>\u5728\u4ED6\u4EEC\u964D\u751F\u4E4B\u540E\u7684\u5341\u5E74\uFF0C\u8FE6\u84DD\u738B\u592B\u5987\u5E26\u7740\u4E00\u53CC\u513F\u5973\u79BB\u5F00\u5929\u7A7A\u57CE\u5230\u6781\u5730\u51FA\u6E38\u3002</p><p>\u9014\u4E2D\u5374\u906D\u86C7\u5996\u4F0F\u51FB\u3002</p><p>\u8FE6\u84DD\u738B\u82E6\u6218\u56DB\u5929\u4E09\u591C\uFF0C\u5996\u87D2\u65A9\u4E4B\u4E0D\u5C3D\u3002\u56DB\u4EBA\u4E8E\u662F\u85CF\u8FDB\u4F4D\u4E8E\u5929\u6DAF\u6D77\u89D2\u7684\u51B0\u5492\u68EE\u6797\u3002</p><p>\u4F38\u624B\u4E0D\u89C1\u4E94\u6307\u7684\u6F06\u9ED1\u6797\u91CE\u4E2D\uFF0C\u7FA4\u87D2\u65E0\u5904\u5BFB\u4EBA\uFF0C\u6B63\u6B32\u64A4\u79BB\u3002</p><p>\u773C\u89C1\u5373\u5C06\u9003\u51FA\u751F\u5929\uFF0C\u5929\u7A7A\u57CE\u7684\u4E24\u4F4D\u6B63\u5C06\u6240\u7387\u63F4\u5175\u4E5F\u5DF2\u903C\u8FD1\u3002\u8FD9\u65F6\uFF0C\u7687\u5B50\u686B\u6469\u5374\u4E0D\u77E5\u4ECE\u4F55\u5904\u638F\u51FA\u4E00\u76CF\u94DC\u706F\uFF0C\u968F\u540E\u8D2A\u624B\u64E6\u4EAE\u2026\u2026</p><p>\u63F4\u5175\u8D76\u81F3\u7684\u65F6\u5019\uFF0C\u53EA\u7559\u4E00\u53CC\u5C0F\u513F\u5E78\u514D\u3002</p><p>\u72FC\u85C9\u4E2D\uFF0C\u6EE1\u9762\u8840\u6C61\u7684\u686B\u6469\u6367\u7740\u90A3\u76CF\u8BE1\u5F02\u94DC\u706F\uFF0C\u8737\u5728\u6BCD\u4EB2\u7684\u5C38\u8EAB\u4E0A\u6E05\u5531\u7740\u65E0\u4EBA\u542C\u61C2\u7684\u7AE5\u8C23\u3002\u5927\u796D\u53F8\u4EA6\u5728\u4ED6\u81C2\u4E0A\u8840\u7BA1\u770B\u89C1\u4E00\u5C42\u7D2B\u9752\u989C\u8272\u3002\u800C\u5728\u4ED6\u5634\u89D2\u6D41\u7740\u7684\uFF0C\u5E76\u975E\u81EA\u5DF1\u7684\u8840\u3002</p><p>\u800C\u82CD\u5170\u6B63\u629A\u6469\u7740\u7236\u4EB2\u90A3\u53CC\u6B7B\u53BB\u7684\u51B0\u51B7\u7FBD\u7FFC\u3002\u5728\u5979\u7684\u53D1\u4E1D\u3001\u9762\u5E9E\u3001\u624B\u8DB3\u8FDE\u540C\u4E00\u88AD\u767D\u8863\u7ADF\u672A\u67D3\u4E00\u4E1D\u8840\u8272\u3002</p><p>\u8FD4\u7A0B\u7684\u65F6\u5019\uFF0C\u82CD\u5170\u548C\u686B\u6469\u4F9D\u65E7\u662F\u5171\u4E58\u5728\u540C\u4E00\u5750\u9A91\u3002\u98DE\u5230\u534A\u7A7A\u7684\u65F6\u5019\uFF0C\u686B\u6469\u662F\u5BB3\u6015\u7684\uFF0C\u4ED6\u60F3\u62B1\u7740\u59D0\u59D0\u7684\uFF0C\u5374\u88AB\u4E0A\u4E86\u94C1\u9563\u3002</p><p>\u300C\u6211\u611F\u5230\uFF0C\u57CE\u5185\u7684\u5A11\u7F57\u53CC\u6811\u2026\u2026\u67AF\u4E86\u3002\u300D\u82CD\u5170\u662F\u53EF\u4EE5\u611F\u89C9\u7684\u5230\u7684\u3002</p><p>\u540E\u6765\u5927\u796D\u53F8\u5728\u5A11\u7F57\u53CC\u6811\u4E0B\u5B9A\u5750\u4E86\u4E03\u591C\uFF0C\u686B\u6469\u662F\u8DEA\u7740\u7684\u3002\u5728\u904D\u5730\u7684\u843D\u53F6\u4E2D\uFF0C\u5927\u796D\u53F8\u7528\u53CC\u624B\u4F5C\u6210\u83B2\u5370\uFF0C\u300C\u524D\u534A\u52AB\u751F\uFF0C\u540E\u534A\u52AB\u706D\u3002\u6C5D\uFF0C\u662F\u4E3A\u706D\u5929\u4E4B\u9B54\u3002\u300D</p><p>\u82CD\u5170\u54ED\u4E86\uFF0C\u5979\u77E5\u9053\u686B\u6469\u662F\u5FC5\u6B7B\u7684\u3002\u4F46\u5979\u7684\u6CEA\u843D\u5728\u67AF\u6811\u7684\u6839\u7CFB\uFF0C\u5B83\u7ADF\u53C8\u6709\u4E86\u751F\u673A\u3002</p><p>\u4E8E\u662F\uFF0C\u5927\u796D\u53F8\u7684\u7985\u4ED7\u505C\u5728\u686B\u6469\u7684\u5FC3\u53E3\u3002\u4ED6\u5C06\u4ED6\u56DA\u7981\u3002</p><p>\u2026\u2026</p><p>\u5341\u5E74\u4E4B\u540E\uFF0C\u5F53\u8FE6\u697C\u82CD\u5170\u6700\u540E\u4E00\u6B21\u7AD9\u5728\u5927\u796D\u53F8\u7684\u8EAB\u65C1\uFF0C\u53C8\u60F3\u8D77\u8FD9\u4E9B\u524D\u4E8B\uFF0C\u5979\u6536\u8D77\u767D\u8272\u7FC5\u8180\u3002</p><p>\u5979\u8BF4\uFF1A\u300C\u6211\u8981\u89C1\u4ED6\u3002\u300D</p><p>\u300C\u6C5D\u53EF\u4EE5\u89C1\uFF0C\u5374\u4E0D\u5BB9\u91CA\u653E\u3002\u300D</p><p>\u300C\u5341\u5E74\u4E4B\u524D\uFF0C\u4ED6\u8D2A\u624B\u64E6\u4EAE\u4E00\u76CF\u706F\u3002\u4F60\u5374\u7528\u5341\u5E74\u7684\u65F6\u5149\u60E9\u7F5A\u4E00\u4E2A\u5C0F\u7AE5\u7684\u7F6A\u3002\u300D</p><p>\u300C\u4E00\u5FF5\u662F\u4E3A\u5FC3\u9B54\u751F\uFF0C\u8F6E\u56DE\u6C38\u4E16\u4E0D\u53EF\u8D4E\u3002\u300D</p><p>\u300C\u4ED6\u5DF2\u7528\u4E09\u5343\u516D\u767E\u4E94\u5341\u4E09\u5929\u7684\u65F6\u95F4\u6DF1\u7701\u8FD9\u4E00\u5FF5\u4E4B\u5DEE\uFF0C\u5927\u796D\u53F8\u8FD8\u89C9\u5F97\u82E6\u77ED\uFF1F\u300D</p><p>\u300C\u76F4\u5230\u8EAB\u6B7B\uFF0C\u4EA6\u4E0D\u5BB9\u4ED6\u89C1\u5929\u5149\u3002\u300D</p><p>\u300C\u5475\uFF0C\u5927\u796D\u53F8\uFF0C\u5047\u5982\u6211\u4E00\u5B9A\u8981\u653E\u5462\uFF1F\u300D</p><p>\u300C\u6C5D\u4E3A\u4E3B\u5BB0\uFF0C\u543E\u5FC5\u81E3\u670D\u767D\u8272\u7FBD\u7FFC\u4E4B\u4E0B\u3002\u672C\u5F53\u6089\u542C\u6C5D\u4E4B\u547D\uFF0C\u5207\u4E0D\u53EF\u8FDD\u6C5D\u4E4B\u65E8\uFF0C\u7136\u2026\u2026\u300D</p><p>\u300C\u4EC0\u4E48\uFF1F\u300D</p><p>\u300C\u686B\u6469\u4E43\u662F\u9B54\u3002\u4E07\u4E0D\u53EF\u4EE5\u653E\u3002\u300D</p><p>\u300C\u4ED6\u662F\u6211\u540C\u751F\u7684\u5F1F\u5F1F\uFF0C\u6211\u8981\u4ED6\u633D\u6551\u6211\u4EEC\u7684\u57CE\u3002\u300D</p><p>\u300C\u543E\u77E5\u6C5D\u5180\u671B\u686B\u6469\u4E0E\u62DC\u4E9A\u65AF\u7687\u671D\u901A\u5A5A\uFF0C\u518D\u4EE5\u7075\u7AE5\u8840\u2026\u2026\u300D</p><p>\u300C\u662F\uFF0C\u5426\u5219\u767D\u9E1F\u9668\u843D\uFF0C\u5929\u7A7A\u57CE\u52BF\u5FC5\u5D29\u584C\u3002\u300D</p><p>\u300C\u5207\u4E0D\u53EF\u4E3A\u3002\u7EB5\u4F7F\u767D\u9E1F\u4E07\u5E74\u4E0D\u5815\uFF0C\u9B54\u6027\u4E00\u6210\uFF0C\u6B64\u57CE\u5FC5\u706D\u3002\u300D</p><p>\u300C\u5927\u796D\u53F8\uFF0C\u6211\u5F88\u4E0D\u5E0C\u671B\u4F60\u963B\u6211\u3002\u300D</p><p>\u300C\u6C5D\u4E3A\u4E3B\u5BB0\u3002\u65CF\u4E2D\u5E73\u6C11\u3001\u50E7\u4FA3\u3001\u540F\u5B98\u3001\u6C99\u5F25\u3001\u5A46\u7F57\u95E8\u3001\u6BD7\u6C99\u95E8\u4F17\uFF0C\u51E1\u6709\u8FDD\u4EE4\u6297\u6CD5\u6291\u6216\u4E0D\u5C0A\u65E8\u610F\u8005\uFF0C\u6C5D\u53EF\u8BF8\u6740\u3002\u300D</p><p>\u300C\u4F60\u2026\u2026\u300D</p><p>\u300C\u543E\u4E0D\u613F\u773C\u671B\u5929\u7A7A\u8499\u5C18\uFF0C\u6C5D\u4EA6\u906D\u9B54\u715E\u2026\u2026\u5341\u5E74\u524D\u4E00\u76CF\u9B54\u706F\uFF0C\u76D6\u56E0\u686B\u6469\u5FC3\u4E2D\u9B54\u5149\u5E7B\u5316\u2026\u2026\u6C5D\u5207\u4E0D\u2026\u2026\u300D</p><p>\u5979\u90A3\u4E00\u5251\u53BB\u52BF\u5FEB\u7EDD\u3002</p><p>\u5979\u90A3\u4E00\u5251\u53BB\u52BF\u5FEB\u7EDD\uFF0C\u53EA\u5728\u624B\u8D77\u624B\u843D\u95F4\u3002\u5979\u76F8\u4FE1\u5E74\u8FC8\u7684\u5927\u796D\u53F8\u4E0D\u4F1A\u611F\u89C9\u4EFB\u4F55\u75DB\u695A\u3002\u90A3\u77AC\u95F4\uFF0C\u5979\u80CC\u4E0A\u4F0F\u7740\u7684\u4E00\u5BF9\u7FFC\u9661\u7136\u94FA\u5F20\uFF0C\u9AD8\u8D35\u7280\u5229\u3002\u51E0\u7C07\u767D\u8272\u7FCE\u7FBD\u5F90\u5F90\u98D8\u5347\uFF0C\u8868\u6F14\u4E00\u573A\u5706\u821E\u7684\u9635\u578B\u3002</p><p>\u5979\u8DEA\u5728\u5927\u796D\u53F8\u7684\u5C38\u8EAB\u524D\uFF1A\u300C\u539F\u8C05\u6211\u3002\u6211\u662F\u4E3A\u4E86\u5929\u7A7A\u57CE\u7684\u6551\u8D4E\u3002\u300D</p><p>\u56FD\u846C\u3002</p><p>\u56FD\u846C\u534E\u4E3D\u3002</p>',51);function t(c,n){return r}var _=e(a,[["render",t]]);export{_ as default};
